<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>OTSM Research Explorer</title>
  <script src="https://cdn.plot.ly/plotly-2.30.0.min.js"></script>
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600&display=swap" rel="stylesheet">
  <style>
    :root {
      --bg: #f8fafc;
      --sidebar-bg: #ffffff;
      --card-bg: #ffffff;
      --text-main: #0f172a;
      --text-muted: #64748b;
      --border: #e2e8f0;
      --primary: #3b82f6;
      --shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
    }
    * { box-sizing: border-box; }
    body {
      margin: 0;
      font-family: 'Inter', sans-serif;
      background: var(--bg);
      color: var(--text-main);
      height: 100vh;
      display: flex;
      overflow: hidden;
    }
    
    /* Sidebar */
    .sidebar {
      width: 320px;
      background: var(--sidebar-bg);
      border-right: 1px solid var(--border);
      display: flex;
      flex-direction: column;
      padding: 24px;
      gap: 24px;
      z-index: 10;
      box-shadow: 4px 0 24px rgba(0,0,0,0.02);
      overflow-y: auto;
    }
    .brand {
      font-size: 20px;
      font-weight: 600;
      letter-spacing: -0.5px;
      color: var(--text-main);
    }
    .brand span { color: var(--primary); }
    
    .control-group {
      display: flex;
      flex-direction: column;
      gap: 8px;
    }
    .control-label {
      font-size: 12px;
      font-weight: 600;
      text-transform: uppercase;
      color: var(--text-muted);
      letter-spacing: 0.5px;
    }
    .select-wrapper {
      position: relative;
    }
    select, input {
      width: 100%;
      padding: 10px 12px;
      border-radius: 8px;
      border: 1px solid var(--border);
      background: var(--bg);
      color: var(--text-main);
      font-size: 14px;
      font-family: inherit;
      outline: none;
      transition: border-color 0.2s, box-shadow 0.2s;
    }
    select:focus, input:focus {
      border-color: var(--primary);
      box-shadow: 0 0 0 3px rgba(59, 130, 246, 0.1);
    }
    
    /* Main Content */
    .main {
      flex: 1;
      position: relative;
      display: flex;
      flex-direction: column;
    }
    #plot {
      flex: 1;
      width: 100%;
    }
    
    /* Details Panel (Floating) */
    .details-panel {
      position: absolute;
      top: 24px;
      right: 24px;
      width: 360px;
      background: var(--card-bg);
      border: 1px solid var(--border);
      border-radius: 12px;
      box-shadow: 0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04);
      padding: 20px;
      display: none; /* Hidden by default */
      flex-direction: column;
      gap: 12px;
      z-index: 20;
      max-height: calc(100vh - 48px);
      overflow-y: auto;
    }
    .details-panel.active { display: flex; animation: slideIn 0.2s ease-out; }
    
    @keyframes slideIn {
      from { opacity: 0; transform: translateY(10px); }
      to { opacity: 1; transform: translateY(0); }
    }
    
    .details-header {
      display: flex;
      justify-content: space-between;
      align-items: flex-start;
      gap: 10px;
    }
    .close-btn {
      background: none;
      border: none;
      cursor: pointer;
      color: var(--text-muted);
      padding: 4px;
    }
    .close-btn:hover { color: var(--text-main); }
    
    .paper-title {
      font-size: 16px;
      font-weight: 600;
      line-height: 1.4;
      margin: 0;
    }
    .paper-meta {
      font-size: 13px;
      color: var(--text-muted);
      margin-top: 4px;
    }
    .tag {
      display: inline-block;
      padding: 2px 8px;
      border-radius: 99px;
      font-size: 11px;
      font-weight: 500;
      background: #eff6ff;
      color: var(--primary);
      margin-top: 8px;
    }
    
    .section-title {
      font-size: 12px;
      font-weight: 600;
      color: var(--text-muted);
      margin-top: 12px;
      margin-bottom: 4px;
      text-transform: uppercase;
    }
    .link-list {
      font-size: 13px;
      word-break: break-all;
    }
    .link-list a {
      color: var(--primary);
      text-decoration: none;
    }
    .link-list a:hover { text-decoration: underline; }
    
    .action-btn {
      display: inline-flex;
      align-items: center;
      justify-content: center;
      width: 100%;
      padding: 10px;
      background: var(--text-main);
      color: white;
      border-radius: 8px;
      text-decoration: none;
      font-size: 14px;
      font-weight: 500;
      margin-top: 16px;
      transition: opacity 0.2s;
    }
    .action-btn:hover { opacity: 0.9; }

    /* Legend Helper */
    .legend-helper {
      margin-top: auto;
      padding-top: 20px;
      border-top: 1px solid var(--border);
      font-size: 12px;
      color: var(--text-muted);
    }
    .legend-item {
      display: flex;
      align-items: center;
      gap: 8px;
      margin-bottom: 6px;
    }
    .dot { width: 10px; height: 10px; border-radius: 50%; border: 1px solid #666; }
    .dot.filled { background: #666; }
    .dot.hollow { background: transparent; }
    
  </style>
</head>
<body>

  <aside class="sidebar">
    <div class="brand">OTSM <span>Explorer</span></div>
    
    <div class="control-group">
      <label class="control-label" for="searchInput">Search</label>
      <input type="text" id="searchInput" placeholder="DOI, Journal, Year...">
    </div>

    <div class="control-group">
      <label class="control-label" for="topicSelect">Topic</label>
      <div class="select-wrapper">
        <select id="topicSelect">
          <option value="All">All</option><option value="Active transportation and land use">Active transportation and land use</option><option value="Air and freight logistics">Air and freight logistics</option><option value="COVID-19 and pandemic">COVID-19 and pandemic</option><option value="Data-driven modeling and prediction">Data-driven modeling and prediction</option><option value="Electric vehicles and ride-sharing">Electric vehicles and ride-sharing</option><option value="Emissions">Emissions</option><option value="Human factors in automated driving">Human factors in automated driving</option><option value="Mobility policy">Mobility policy</option><option value="Optimization">Optimization</option><option value="Public transit">Public transit</option><option value="Resilience and evacuation">Resilience and evacuation</option><option value="Safety aspects of driving behavior">Safety aspects of driving behavior</option><option value="Supply chain">Supply chain</option><option value="Traffic behaviour">Traffic behaviour</option><option value="Traffic flow and control">Traffic flow and control</option>
        </select>
      </div>
    </div>

    <div class="control-group">
      <label class="control-label" for="codeSelect">Code Availability</label>
      <div class="select-wrapper">
        <select id="codeSelect">
          <option value="All">All</option><option value="Code available">Code available</option><option value="No code">No code</option>
        </select>
      </div>
    </div>
    
    <div class="control-group">
      <label class="control-label" for="dataSelect">Data Availability</label>
      <div class="select-wrapper">
        <select id="dataSelect">
          <option value="All">All</option><option value="Data available">Data available</option><option value="No data">No data</option>
        </select>
      </div>
    </div>

    <div class="legend-helper">
      <div class="legend-item">
        <div class="dot filled"></div>
        <span>Code Available (Star)</span>
      </div>
      <div class="legend-item">
        <div class="dot hollow"></div>
        <span>No Code (Circle)</span>
      </div>
      <div style="margin-top:8px; line-height:1.4;">
        Use the lasso tool in the plot to select multiple points.
      </div>
    </div>
  </aside>

  <main class="main">
    <div id="plot"></div>
    
    <div id="details-panel" class="details-panel">
      <div class="details-header">
        <div>
          <h3 class="paper-title" id="d-doi">DOI</h3>
          <div class="paper-meta">
            <span id="d-year">2023</span> · <span id="d-journal">Journal Name</span>
          </div>
          <div class="tag" id="d-topic">Topic Name</div>
        </div>
        <button class="close-btn" onclick="closeDetails()">✕</button>
      </div>
      
      <div>
        <div class="section-title">Code</div>
        <div class="link-list" id="d-code"></div>
      </div>
      
      <div>
        <div class="section-title">Data</div>
        <div class="link-list" id="d-data"></div>
      </div>
      
      <a href="#" target="_blank" id="d-link" class="action-btn">Open Paper DOI ↗</a>
    </div>
  </main>

    const layout = {
      margin: {l: 20, r: 20, t: 20, b: 20},
      paper_bgcolor: "#f8fafc",
      plot_bgcolor: "#f8fafc",
      hovermode: "closest",
      dragmode: "pan",
      showlegend: false,
      font: {
        family: "'Inter', sans-serif",
        color: "#0f172a"
      },
      xaxis: {
        showgrid: true,
        gridcolor: "#e2e8f0",
        zeroline: false,
        showticklabels: false
      },
      yaxis: {
        showgrid: true,
        gridcolor: "#e2e8f0",
        zeroline: false,
        showticklabels: false
      }
    };

    const config = {
      responsive: true,
      displaylogo: false,
      scrollZoom: true,
      modeBarButtonsToRemove: ['lasso2d', 'select2d']
    };

    Plotly.newPlot("plot", traces, layout, config).then(gd => {
      gd.on("plotly_click", (ev) => {
        if (!ev || !ev.points || !ev.points.length) return;
        const pt = ev.points[0];
        showDetails(pt);
      });
    });

    // --- Details Panel Logic ---
    const panel = document.getElementById("details-panel");
    
    function showDetails(pt) {
      const cd = pt.customdata; 
      // customdata: [doi_url, year, journal, code_disp, code_flag, data_disp, data_flag]
      
      document.getElementById("d-doi").textContent = pt.text;
      document.getElementById("d-year").textContent = cd[1];
      document.getElementById("d-journal").textContent = cd[2];
      document.getElementById("d-topic").textContent = pt.data.meta.topic;
      
      document.getElementById("d-code").innerHTML = cd[3];
      document.getElementById("d-data").innerHTML = cd[5];
      
      const linkBtn = document.getElementById("d-link");
      linkBtn.href = cd[0];
      
      panel.classList.add("active");
    }
    
    function closeDetails() {
      panel.classList.remove("active");
    }
    window.closeDetails = closeDetails;

    // --- Filtering Logic ---
    const searchInput = document.getElementById("searchInput");
    const topicSelect = document.getElementById("topicSelect");
    const codeSelect = document.getElementById("codeSelect");
    const dataSelect = document.getElementById("dataSelect");

    function updateVisibility() {
      const topic = topicSelect.value;
      const code = codeSelect.value;
      const data = dataSelect.value;
      const search = searchInput.value.toLowerCase();

      // If search is active, we need to filter points within traces.
      // If search is empty, we can just toggle trace visibility.
      
      if (search === "") {
        const vis = traces.map(tr => {
          const okTopic = (topic === "All") || (tr.meta && tr.meta.topic === topic);
          const okCode =
            (code === "All") ||
            (code === "Code available" && tr.meta && tr.meta.code === true) ||
            (code === "No code" && tr.meta && tr.meta.code === false);
          const okData =
            (data === "All") ||
            (data === "Data available" && tr.meta && tr.meta.data === true) ||
            (data === "No data" && tr.meta && tr.meta.data === false);
            
          return okTopic && okCode && okData;
        });
        
        // Restore original arrays if they were filtered?
        // We need to store original arrays in 'meta' or similar if we modify them.
        // But here we are just toggling 'visible'.
        // However, if we previously filtered arrays for search, we need to restore them.
        // Plotly doesn't automatically restore.
        
        // To support Search properly, we should ALWAYS update x/y arrays.
        // But that's slow.
        
        // Hybrid approach:
        // If search was previously active, we must restore.
        // Let's just assume we always update 'visible' AND 'x/y' if search is involved.
        
        // Actually, let's just implement Search by filtering 'visible' traces if possible?
        // No, search is per-point.
        
        // Let's implement Search by updating 'marker.opacity' array?
        // That's faster than updating x/y?
        // Or just update x/y.
        
        Plotly.restyle("plot", "visible", vis);
        
        // We also need to reset x/y to full if they were filtered.
        // But we don't have a reference to full x/y easily unless we stored it.
        // Let's store it in 'customdata' or just rely on 'traces' variable which holds the initial data.
        // The 'traces' variable in JS holds the initial full data.
        // So we can just re-assign x/y from 'traces' to the plot.
        
        const update = {
            x: traces.map(t => t.x),
            y: traces.map(t => t.y)
        };
        Plotly.restyle("plot", update);
        
      } else {
        // Search is active.
        // We need to filter x/y arrays for ALL traces (even hidden ones, though hidden ones don't matter).
        
        const newX = [];
        const newY = [];
        const newVis = [];
        
        traces.forEach(tr => {
            // Check categorical filters first
            const okTopic = (topic === "All") || (tr.meta && tr.meta.topic === topic);
            const okCode =
                (code === "All") ||
                (code === "Code available" && tr.meta && tr.meta.code === true) ||
                (code === "No code" && tr.meta && tr.meta.code === false);
            const okData =
                (data === "All") ||
                (data === "Data available" && tr.meta && tr.meta.data === true) ||
                (data === "No data" && tr.meta && tr.meta.data === false);
            
            if (!okTopic || !okCode || !okData) {
                newVis.push(false);
                newX.push(tr.x); // Doesn't matter
                newY.push(tr.y);
                return;
            }
            
            // Filter points by search
            const filteredX = [];
            const filteredY = [];
            // We need to filter all attributes to keep alignment?
            // Plotly is strict. If we shorten x/y, we must shorten text/customdata/marker.color etc.
            // This is getting too complex for a simple script.
            
            // Alternative: Set non-matching points to NaN?
            // Plotly handles NaN by not drawing.
            // This preserves index alignment for customdata!
            
            const currentX = tr.x;
            const currentY = tr.y;
            const texts = tr.text; // DOI
            const journals = tr.customdata.map(c => c[2]); // Journal
            const years = tr.customdata.map(c => c[1]); // Year
            
            const finalX = [];
            const finalY = [];
            
            let hasPoints = false;
            
            for(let i=0; i<currentX.length; i++) {
                const t = (texts[i] || "").toLowerCase();
                const j = (journals[i] || "").toLowerCase();
                const y = (years[i] || "").toLowerCase();
                
                if (t.includes(search) || j.includes(search) || y.includes(search)) {
                    finalX.push(currentX[i]);
                    finalY.push(currentY[i]);
                    hasPoints = true;
                } else {
                    finalX.push(null); // Hide
                    finalY.push(null);
                }
            }
            
            newX.push(finalX);
            newY.push(finalY);
            newVis.push(hasPoints); // Only show trace if it has matching points? Or always show?
        });
        
        Plotly.restyle("plot", {
            x: newX,
            y: newY,
            visible: newVis
        });
      }
    }

    document.getElementById("topicSelect").addEventListener("change", updateVisibility);
    document.getElementById("codeSelect").addEventListener("change", updateVisibility);
    document.getElementById("dataSelect").addEventListener("change", updateVisibility);
    document.getElementById("searchInput").addEventListener("input", updateVisibility);
  </script>
